import React from "react";
import {Panel, Table} from "rsuite";

const Home = () => {

  const imgStyles = {
      height: "20rem",
      width: "100%"
  }
  const {Column, HeaderCell, Cell} = Table
  return (
    <div style={{
        padding: "1.3rem",
        display: "flex",
        justifyContent: "space-around"
    }}>
      <div className="leftSide">
        <Panel shaded bordered bodyFill style={{
            display: 'inline-block',
            width: "100%",
        }}>
            <img style={imgStyles} src="https://via.placeholder.com/500"/>
            <Panel header="Latest Changes">
                <Table>
                    <Column align="Center" fixed>
                        <HeaderCell>Project</HeaderCell>
                        <Cell dataKey="project_name" />
                    </Column>
                    <Column align="Center" fixed>
                        <HeaderCell>Section</HeaderCell>
                        <Cell dataKey="code"/>
                    </Column>
                    <Column align="Center" fixed>
                        <HeaderCell>Snippet</HeaderCell>
                        <Cell dataKey="snippet"/>
                    </Column>
                    <Column align="Center" fixed>
                        <HeaderCell>Date</HeaderCell>
                        <Cell dataKey="date"/>
                    </Column>
                </Table>
            </Panel>
        </Panel>
      </div>
      <div className="rightside">
          <Panel shaded bordered bodyFill header="Projects"style={{
              width:"100%"
          }}>

          </Panel>

      </div>
    </div>
  );
};

export default Home;
